const Video = () => {
  return (
    <div className="App">
      <video width="750" height="500" controls>
        <source src="Liikakalastus.mp4" type="video/mp4" />
      </video>
      <div className="comments-section">
        <h2>Comments</h2>
        <div className="comment">
          <p>John Doe: This video is very informative. Thanks for sharing!</p>
          <div className="nested-comment">
            <p>Jane Smith: I agree, it's an important issue that needs more attention.</p>
          </div>
        </div>
        <div className="comment">
          <p>David Johnson: Great video! I learned a lot.</p>
        </div>
        {/* Add more comments as needed */}
      </div>
    </div>
  );
};

export default Video;
